css:
@-moz-document domain(surviv.io)
{

  #background
  {
    background-image: url(https://wallpaperboat.com/wp-content/uploads/2020/04/anime-girls-with-guns-wallpaper-free.jpg) !important;
  }

  #start-top-left
  {
    visibility: hidden !important;
  }

  #featured-streamers
  {
    visibility: hidden !important;
  }

  #start-bottom-left
  {
    visibility: hidden !important;
  }

  #start-bottom-middle
  {
    visibility: hidden !important;
  }

  .menu-option
  {
    border-radius: 0px !important;
    border-color: #7886d6 !important;
  }

  .btn-green
  {
    border-bottom: 0px !important;
    background: #cde0f7 !important;
    color: #7886d6 !important;
    box-shadow: inset 0 -2px #cde0f7;
  }

  .btn-team-option
  {
    border-bottom: 0px !important;
    background: #cde0f7 !important;
    color: #7886d6 !important;
    box-shadow: inset 0 -2px #cde0f7;
  }

  .account-details-button-wrapper
  {
    border-bottom: 0px !important;
    background: #cde0f7 !important;
    color: #7886d6 !important;
    box-shadow: inset 0 -2px #cde0f7 !important;
  }

  #btn-pass-locked
  {
    border-bottom: 0px !important;
    background: #cde0f7 !important;
    color: #7886d6 !important;
    box-shadow: inset 0 -2px #cde0f7;
  }

  #btn-customize
  {
    border-bottom: 0px !important;
    background: #cde0f7 !important;
    background-image: url(http://surviv.io/img/emotes/surviv.svg) !important;
    background-position: 8px 5px !important;
    background-repeat: no-repeat !important;
    background-size: 28px !important;
    color: #CC0000 !important;
    box-shadow: inset 0 -2px #cde0f7;
  }

  #btn-help
  {
    border-bottom: 0px !important;
  }
}
